import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'

/* import the fontawesome core */
import { library } from '@fortawesome/fontawesome-svg-core'

/* import font awesome icon component */
import { FontAwesomeIcon } from '@fortawesome/vue-fontawesome'

/* import specific icons */
import { faUserSecret,faFlag,faEye,faPenToSquare,faCircleCheck,faThumbsUp,faCircleXmark,faChalkboard,faTableList,faTList} from '@fortawesome/free-solid-svg-icons'
library.add(faUserSecret,faFlag,faEye,faPenToSquare,faCircleCheck,faThumbsUp,faCircleXmark,faChalkboard,faTableList)


/* add font awesome icon component */
Vue.component('font-awesome-icon', FontAwesomeIcon)

Vue.config.productionTip = false

new Vue({
  vuetify,
  render: h => h(App)
}).$mount('#app')
